import React from "react";
import { Line } from "react-chartjs-2";
import "chart.js/auto";

const stockData = {
  labels: ["Entry", "Exit"],
  datasets: [
    {
      label: "AAPL",
      data: [150, 160],
      borderColor: "rgba(75,192,192,1)",
      fill: false,
    },
    {
      label: "GOOGL",
      data: [2700, 2800],
      borderColor: "rgba(255,99,132,1)",
      fill: false,
    },
    {
      label: "TSLA",
      data: [700, 720],
      borderColor: "rgba(54,162,235,1)",
      fill: false,
    },
    {
      label: "AMZN",
      data: [3300, 3400],
      borderColor: "rgba(255,206,86,1)",
      fill: false,
    },
    {
      label: "MSFT",
      data: [290, 300],
      borderColor: "rgba(153,102,255,1)",
      fill: false,
    },
    {
      label: "NFLX",
      data: [550, 570],
      borderColor: "rgba(255,159,64,1)",
      fill: false,
    },
  ],
};

const WatchlistWrapper = styled.div`
  width: 80%;
  margin: 50px auto;
  background: white;
  padding: 20px;
  border-radius: 10px;
  box-shadow: 0 0 10px rgba(0, 0, 0, 0.1);
`;

const WatchlistTitle = styled.h2`
  font-size: 1.5rem;
  font-family: Ubuntu;
  text-align: center;
  margin-bottom: 20px;
`;

const GraphContainer = styled.div`
  width: 100%;
  height: 300px;
  margin-bottom: 30px;
`;

export const Home = () => {
  const [clicked, setClicked] = useState(false);
  const [showDisclaimer, setShowDisclaimer] = useState(!sessionStorage.getItem("disclaimerShown"));

  const handleClick = () => {
    setClicked(!clicked);
  };

  const closeDisclaimer = () => {
    setShowDisclaimer(false);
    sessionStorage.setItem("disclaimerShown", "true");
  };

  const Disclaimer = ({ onClose }) => {
    return (
      <DisclaimerWrapper show={true}>
        <DisclaimerBox>
          <CloseButton onClick={onClose}>×</CloseButton>
          <DisclaimerTitle>DISCLAIMER</DisclaimerTitle>
          <DisclaimerText>
            Stock of The Day (SOTD) is a tool intended to assist you in identifying potential stocks to trade. However, it should not be the sole basis for your investment decisions. It's important to conduct your own research and consult with a financial advisor before making any trades. Please note that the regular SOTD only covers US stocks and all information is based on Eastern Standard Time (EST).
          </DisclaimerText>
          <AgreeButton onClick={onClose}>I AGREE</AgreeButton>
        </DisclaimerBox>
      </DisclaimerWrapper>
    );
  };

  return (
    <div>
      <br />
      <br />
      <br />
      <br />
      <br />
      {showDisclaimer && <Disclaimer onClose={closeDisclaimer} />}
      <HomeWrapper1>
        <ShootingStar />
        <HomeText1>
          <div> Get the best, Earn the most </div>
        </HomeText1>
        <HomeText2>
          <div> Utilizing AI to generate </div>
          <div> top-tier stocks daily </div>
        </HomeText2>
        <HomeText3 onClick={handleClick}>
          <a href="/sotd" style={{ color: "black" }}>Today's watchlist</a>
        </HomeText3>
        <HomeText4>
          <div> We are </div>
          <div>Coming soon… </div>
        </HomeText4>
        <HomeText5>
          <div> SOTD app </div>
        </HomeText5>
        <Bullimg src={Bull} />
        <Phoneimg src={Phone} />
        <WatchlistWrapper>
          <WatchlistTitle>Previous Stock Performance</WatchlistTitle>
          <GraphContainer>
            <Line data={stockData} />
          </GraphContainer>
        </WatchlistWrapper>
      </HomeWrapper1>
    </div>
  );
};
